window.bookSummaryJSON = "<p>I thought things couldn't get worse. I was wrong. <br> I found out what I really wanted and was forced to give him up. Just as I found out who I really am, I was presented to the elusive Horde King as a gift. <br> This was the mystical being I was hidden from for more than 20 years. <br> Although Ryder promised to save me, I couldn't let him get near this creature, so I willingly (sort of) signed myself over to be his new plaything. <br> Now in the Horde Realm, nothing is going remotely like I thought it would. <br> My powers and emotions are on the fritz, and each day seems to bring surprises that I am not sure how to deal with. <br> The Horde King thinks he has me exactly where he wants me. <br> He thinks he has taken all of my options away. <br> I still have choices. <br> Embracing what destiny has planned for me, or escaping it.</p>"; 
